var img = new Image();
img.src='images/hole.png';
var gunsound=new Audio();
gunsound.src = "sounds/hole.mp3";

var gun = {
  md:function(){

    var img2 = new Image();
    img2.src='images/fire.gif';
    img2.style.position="absolute";
    img2.style.zindex="10";
    img2.style.pointerEvents = "none";
    gunsound.loop=true;
    gunsound.play();

    canvas.style.cursor = "url('images/gun1.gif'), auto";

    var x=mouse.x-50+Math.floor((Math.random() * 10));
    var y= mouse.y-50+Math.floor((Math.random() * 10));
    ctx.drawImage(img, x, y  );
    y=mouse.y-5;
    x=mouse.x-5;
    img2.style.top=y+'px';
    img2.style.left=x+'px';
    document.getElementById("paint").appendChild(img2);

    setTimeout(function() { document.getElementById("paint").removeChild(img2); }, 100);

    canvas.addEventListener('mousemove',gun.md,false);
  },

  mu:function() {
    gunsound.pause();
    canvas.style.cursor = "url('images/gun.gif'), auto";
    gunsound.loop=false;
    canvas.removeEventListener('mousemove',gun.md,false);
  }

}


